import React, { useEffect } from "react";
import axios from "axios";

const getPhotos = () => {
  return axios
    .get("https://picsum.photos/v2/list")
    .then((response) => {
      return response.data;
    })
    .catch((error) => {
      console.log(error);
    });
};

const Photos = () => {
  useEffect(() => {
    getPhotos().then((images) => {
      console.log(images);
    });
  }, []);
  return <div>{}</div>;
};

export default Photos;
